import React, { useState } from 'react';
import { Navbar, Container, Nav, NavDropdown, Button, Form, Card, Badge, Row, Col } from 'react-bootstrap';
import { Link, useNavigate } from 'react-router-dom';
import { UserAuth } from '../context/AuthContext';
import 'bootstrap/dist/css/bootstrap.min.css';
import './Register.css';

export const Register = () => {

  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [error, setError] = useState('')
  const { createUser } = UserAuth();
  const navigate = useNavigate()

  const handleSubmit = async (e) => {
    e.preventDefault();
    setError('');
    try {
      await createUser(email, password);
      navigate('/account')
    } catch (e) {
      setError(e.message);
      console.log(e.message);
    }
  };


  return (
    <div>
      <header className="App-header">

        <h1 class="mb-4">Register</h1>

        <Card style={{ color: "#000" }}>
          {/* <Card.Img src= {logo} /> */}
          <Card.Body>
          <form>
            <div class="row">
              <div class="form-group col-md-6">
                <label for="inputFName" class="h5">First Name</label>
                <input type="text" class="form-control" id="inputFName" placeholder="First Name"/>
              </div>
              <div class="form-group col-md-6">
                <label for="inputLName" class="h5">Last Name</label>
                <input type="text" class="form-control" id="inputLName" placeholder="Last Name"/>
              </div>
            </div>
            <div class="form-group">
              <label for="inputAddress" class="h5">Address</label>
              <input type="text" class="form-control" id="inputAddress" placeholder="1234 Main St"/>
            </div>
            <div class="form-group">
              <label for="phonenumber" class="h5">Phone Number</label>
              <input type="text" class="form-control" id="phonenumber" placeholder="000-000-0000"/>
            </div>

            <div class="row">
              <div class="form-group col-md-6">
                <label for="inputEmail4" class="h5">Email</label>
                <input onChange={(e) => setEmail(e.target.value)} type="email" class="form-control" id="inputEmail4" placeholder="Email"/>
              </div>
              <div class="form-group col-md-6">
                <label for="inputPassword4" class="h5">Password</label>
                <input onChange={(e) => setPassword(e.target.value)} type="password" class="form-control" id="inputPassword4" placeholder="Password"/>
              </div>
            </div>

            <div class="form-row">
              <div class="form-group col-md-4">
                <label for="gender" class="h5">Gender</label>
                <select id="gender" class="form-control">
                  <option selected class="h5">Choose...</option>
                  <option>Male</option>
                  <option>Female</option>
                </select>
              </div>
              <div class="form-group col-md-2">
                <label for="inputAge" class="h5">Age</label>
                <input type="text" class="form-control" id="inputAge"/>
              </div>
            </div>
            <div class="btn-group d-flex mt-3 mb-2" role="group" aria-label="...">
              <Button className="loginButton mt-3 btn-block  w-90" variant="success" type="submit"> Register </Button>
            </div>
          </form>
            <Card.Text>
              We fly your pets, not you.
            </Card.Text>
          </Card.Body>  
        </Card>
      </header>
    </div>
  )
}

export default Register
